INSERT INTO `oc_bm_post_description` VALUES (154,10,2,'Cách nhận biết điểm khác biệt giữa chó Alaska và Husky.','','&lt;p style=&quot;text-align: center; &quot;&gt;&lt;em&gt;Nếu bạn là một người yêu các giống chó nhập khẩu thì chắc hẳn sẽ không xa lạ gì với hai giống&amp;nbsp;&lt;/em&gt;&lt;strong&gt;&lt;em&gt;chó Alaska và Husky&lt;/em&gt;&lt;/strong&gt;&lt;em&gt;. Chúng đều có cùng nguồn gốc từ vùng đất Bắc Âu lạnh giá và đặc điểm ngoại hình dễ nhầm lẫn. Vậy hãy cùng&amp;nbsp;&lt;strong&gt;Tin tức thú cưng&lt;/strong&gt;&amp;nbsp;tìm hiểu xem chúng có điểm gì giống/khác nhau và giá bán hai giống chó này ở Việt Nam nhé.&lt;/em&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center; &quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;h2 style=&quot;text-align: center;&quot;&gt;Cách nhận biết qua đặc điểm tự nhiên&lt;/h2&gt;&lt;h3 style=&quot;text-align: center;&quot;&gt;Ngoại hình&lt;/h3&gt;&lt;p style=&quot;text-align: center;&quot;&gt;So với chó Alaska thì Husky lại có thân hình nhỏ nhắn thanh thoát hơn nhiều. Trong khi chó Husky chỉ có chiều cao khoảng 50-55 cm và nặng 25-35 kg. Thì chó Alaska lại nhỉnh hơn hẳn với chiều cao khoảng 55-65 cm và nặng 35-45 kg đối với dòng Alaska tiêu chuẩn (Standard).&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;cho-alaska-va-husky&quot; data-cke-saved-src=&quot;https://i2.wp.com/tintucthucung.com/wp-content/uploads/2019/04/alaska-husky.jpg?w=1100&amp;amp;ssl=1&quot; src=&quot;https://i2.wp.com/tintucthucung.com/wp-content/uploads/2019/04/alaska-husky.jpg?w=1100&amp;amp;ssl=1&quot;&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;em&gt;Ngoại hình của chó Alaska và Husky&lt;/em&gt;&lt;/p&gt;&lt;p&gt;&lt;div style=&quot;text-align: center;&quot;&gt;Dòng&amp;nbsp;&lt;strong&gt;Giant Alaska&lt;/strong&gt;&amp;nbsp;khổng lồ có chiều cao cơ thể hơn 70 cm và cân nặng lên tới 80kg khi trưởng thành.&lt;/div&gt;&lt;div style=&quot;text-align: center;&quot;&gt;Ngược lại, các bé Husky trông nhỏ nhắn và thanh thoát hơn so với Alaska, thường có chiều cao khoảng 50 đến 55cm và nặng 25 đến 35kg.&lt;/div&gt;&lt;/p&gt;&lt;h3 style=&quot;text-align: center;&quot;&gt;Bộ lông&lt;/h3&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Chó Husky có lông đuôi xù, cụp, khi đi thì đuôi dựng đứng. Còn Alaska lúc nào đuôi cũng cuộn tròn trên lưng .&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;bo-long-cua-cho-alaska&quot; data-cke-saved-src=&quot;https://i0.wp.com/tintucthucung.com/wp-content/uploads/2019/04/cach-nuoi-cho-alaska-3.png?w=1100&amp;amp;ssl=1&quot; src=&quot;https://i0.wp.com/tintucthucung.com/wp-content/uploads/2019/04/cach-nuoi-cho-alaska-3.png?w=1100&amp;amp;ssl=1&quot;&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;em&gt;Lông đuôi của chó Alaska cuộn tròn&lt;/em&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;em&gt;&lt;strong&gt;Click&lt;/strong&gt;&amp;nbsp;để xem thêm về&amp;nbsp;&lt;a data-cke-saved-href=&quot;https://tintucthucung.com/cho-alaska-nhung-thong-truoc-khi-nuoi/&quot; href=&quot;https://tintucthucung.com/cho-alaska-nhung-thong-truoc-khi-nuoi/&quot;&gt;chó alaska&lt;/a&gt;&amp;nbsp;&lt;strong&gt;tại đây.&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Màu lông của&amp;nbsp;&lt;strong&gt;alaska và husky&lt;/strong&gt;&amp;nbsp;về cơ bản khá giống nhau. Đều có thể là đen trắng, xám trắng, nâu đỏ trắng… Chỉ khác nhau về độ dài và độ dày. Lông của chó Alaska thường dài hơn dày hơn và trông xù xì, còn lông Husky khá ngắn, mỏng và mềm mượt, trông tinh tế hơn. Có lẽ khi về môi trường khí hậu ở Việt Nam, chó Alaska hợp hơn so với chó Husky nên chúng phát triển tốt hơn.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;cho-con-alaska&quot; data-cke-saved-src=&quot;https://i0.wp.com/tintucthucung.com/wp-content/uploads/2019/04/cho-alaska-4.jpg?w=1100&amp;amp;ssl=1&quot; src=&quot;https://i0.wp.com/tintucthucung.com/wp-content/uploads/2019/04/cho-alaska-4.jpg?w=1100&amp;amp;ssl=1&quot;&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;em&gt;Chó con Alaska rất dễ thương&lt;/em&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Nếu nói chó Alaska có bộ lông dày hơn và có thân hình to hơn so với chó Husky là không hoàn toàn đúng, vì vốn dĩ khi hai giống chó này được nuôi dưỡng tại các nước bản địa thì vóc dáng và mức độ dày của lông chúng tương đương nhau. Nhưng tại Việt Nam thì Husky lại có bộ lông ngắn và mỏng hơn Alaksa.&lt;/p&gt;&lt;h3 style=&quot;text-align: center;&quot;&gt;Đôi mắt của Alaska và Husky&lt;/h3&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Một đặc điểm để nhận biết giống chó Alaska và Husky&lt;strong&gt;&amp;nbsp;&lt;/strong&gt;nữa đó là về màu mắt của chúng. Với chó Alaska mắt của chúng chỉ có màu nâu (nâu đen hoặc nâu đỏ), theo tiêu chuẩn giống chó Alaska được tổ chức hiệp hội chó thế giới (AKC) quy định nếu mắt&lt;strong&gt;&amp;nbsp;&lt;/strong&gt;chó Alaska&lt;strong&gt;&amp;nbsp;&lt;/strong&gt;có màu khác với màu nâu nghĩa là con chó đó đã bị lai tạp và không được tham gia thi đấu ở các giải DogShow.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;cho-alaska-khi-con-nho&quot; data-cke-saved-src=&quot;https://i0.wp.com/tintucthucung.com/wp-content/uploads/2019/04/cach-nuoi-cho-alaska-1-1.jpg?w=1100&amp;amp;ssl=1&quot; src=&quot;https://i0.wp.com/tintucthucung.com/wp-content/uploads/2019/04/cach-nuoi-cho-alaska-1-1.jpg?w=1100&amp;amp;ssl=1&quot;&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;em&gt;Mắt của chó Alaska thường là màu nâu hoặc màu đen&lt;/em&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Husky lại có màu mắt đa dạng hơn với màu xanh biển, xanh da trời, xanh lá cây, màu hổ phách, màu nâu. Đôi khi có một số cá thể có mắt 2 màu màu nửa xanh nửa nâu nhưng rất hiếm.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;mau-mat-husky&quot; data-cke-saved-src=&quot;https://i2.wp.com/tintucthucung.com/wp-content/uploads/2019/04/cho-husky-2.jpg?w=1100&amp;amp;ssl=1&quot; src=&quot;https://i2.wp.com/tintucthucung.com/wp-content/uploads/2019/04/cho-husky-2.jpg?w=1100&amp;amp;ssl=1&quot;&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;em&gt;Mắt của chó Husky có màu xanh nước biển&lt;/em&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Thêm một phần nữa là về phần tai chó, ở chó Husky&lt;strong&gt;&amp;nbsp;&lt;/strong&gt;khoảng cách 2 tai gần nhau hơn so với tai chó Alaska.&lt;/p&gt;&lt;h2 style=&quot;text-align: center;&quot;&gt;Giá bán giống chó Alaska và Husky ở Việt Nam&lt;/h2&gt;&lt;h3 style=&quot;text-align: center;&quot;&gt;Giá chó Alaska&lt;/h3&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Chó Alaska nhập Trung Quốc được bán tại Việt Nam với mức giá khả rẻ, từ 5-7 triệu đồng/1 bé. Tuy nhiên dòng chó giá rẻ này không đảm bảo được chất lượng về mặt nguồn gốc, sức khỏe.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Chó Alaska sinh tại Việt Nam thường được bán với giá khá thấp, dao động từ 8- 15 triệu/1 bé Standard và 12 – 22 triệu đồng/1 bé đối với Giant khổng lồ. Đây là mức giá trung bình mà bạn có thể mua được một chú chó Alaska được sinh sản trong nước.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;gia-cho-alaska&quot; data-cke-saved-src=&quot;https://i1.wp.com/tintucthucung.com/wp-content/uploads/2019/04/cho-alaska.jpg?w=1100&amp;amp;ssl=1&quot; src=&quot;https://i1.wp.com/tintucthucung.com/wp-content/uploads/2019/04/cho-alaska.jpg?w=1100&amp;amp;ssl=1&quot;&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;em&gt;Giá bán của chó Alaska&lt;/em&gt;&amp;nbsp;tại Việt Nam&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Những giống chó Alaska được nhập từ Thái hoặc Indonesia thường có chất lượng và sức khỏe tốt hơn chó tại Việt Nam. Giống chó này về Việt Nam thường được bán với giá từ 15 – 25 triệu đồng.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Giá bán chó Alaska nhập khẩu từ quê hương Hoa Kỳ của giống chó này là cao nhất. Nước Mỹ là quê hương của giống chó Alaska hiện đang được nuôi trên toàn thế giới. Chính vì vậy, nếu bạn muốn mua giống chó được nhập khẩu từ Âu – Mỹ, bạn phải chấp nhận bỏ ra một mức giá khá cao, khoảng 100 triệu đồng trên một con (không bao gồm phí vận chuyển). Do các quy định ngặt nghèo về xuất khẩu vật nuôi của nước này. Đối với&amp;nbsp;&lt;strong&gt;chó Alaska&lt;/strong&gt;&amp;nbsp;nhập từ châu Âu (chủ yếu là Nga và các nước Đông Âu), giá chỉ bằng 2/3 cho đến ½ so với chó nhập từ Mỹ.&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;cho-alaska-keo-xe&quot; data-cke-saved-src=&quot;https://i1.wp.com/tintucthucung.com/wp-content/uploads/2019/04/cho-alaska-1.jpg?w=1100&amp;amp;ssl=1&quot; src=&quot;https://i1.wp.com/tintucthucung.com/wp-content/uploads/2019/04/cho-alaska-1.jpg?w=1100&amp;amp;ssl=1&quot;&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;em&gt;Chó Alaska nhập khẩu từ Âu – Mỹ có giá rất cao&lt;/em&gt;&lt;/p&gt;&lt;h3 style=&quot;text-align: center;&quot;&gt;Giá bán chó Husky&lt;/h3&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Những chú&lt;strong&gt;&amp;nbsp;&lt;/strong&gt;Husky không rõ nguồn gốc, có thể là&lt;strong&gt;&amp;nbsp;&lt;/strong&gt;chó Husky đi lạc hoặc được nhập khẩu từ Trung Quốc. Giá chó Husky loại này cũng khá rẻ, chỉ từ 3-5 triệu đồng. Với giá rẻ như thế, đồng nghĩa với việc chất lượng sẽ không được đảm bảo, độ rủi ro khi mua những chú chó Husky này rất cao. Chó Husky loại này chắc chắn không có giấy tờ của bất kì tổ chức nào. Bạn hầu như không có cơ hội đưa chúng tham gia các cuộc thi về chó quốc tế.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;gia-cho-husky&quot; data-cke-saved-src=&quot;https://i0.wp.com/tintucthucung.com/wp-content/uploads/2019/04/cho-husky.jpg?w=1100&amp;amp;ssl=1&quot; src=&quot;https://i0.wp.com/tintucthucung.com/wp-content/uploads/2019/04/cho-husky.jpg?w=1100&amp;amp;ssl=1&quot;&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;em&gt;Giá bán của Husky tại Việt Nam&lt;/em&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Những em Husky có khoảng giá 7-9 triệu thường được sinh ra tại Việt Nam. Tuy nhiên, ngoại hình và tính cách không có gì đặc biệt. Bố mẹ cũng có xuất thân bình thường. Giá có sự chênh lệch dựa vào màu lông: màu đen – trắng: 7-8 triệu&amp;nbsp;còn&amp;nbsp;màu xám – trắng thì 8-9 triệu. Đây cũng được coi là nguồn cung chó Husky phổ biến nhất tại Việt Nam do giá thành chúng khá phù hợp với túi tiền của người Việt.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Những em Husky&lt;strong&gt;&amp;nbsp;&lt;/strong&gt;sinh ra tại Việt Nam có bố hoặc mẹ là chó nhập ngoại, ngoại hình và sức khỏe đạt chuẩn có giá 9 – 12 triệu đồng. Khi mua chó Husky loại này, bạn sẽ được cung cấp hình ảnh + giấy tờ đầy đủ của con bố mẹ. Giá còn dao động phụ thuộc vào con bố hoặc mẹ nhập ngoại từ nước nào. Từ Thái Lan sẽ rẻ hơn nhiều từ các nước Châu Âu.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;cho-husky-truong-thanh&quot; data-cke-saved-src=&quot;https://i1.wp.com/tintucthucung.com/wp-content/uploads/2019/04/cho-husky-1.jpg?w=1100&amp;amp;ssl=1&quot; src=&quot;https://i1.wp.com/tintucthucung.com/wp-content/uploads/2019/04/cho-husky-1.jpg?w=1100&amp;amp;ssl=1&quot;&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;em&gt;Nên mua những chú Husky có giấy tờ rõ ràng&lt;/em&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Những bé Husky thuần chủng nhập khẩu từ Thái Lan thường có giá khoảng 9 – 15 triệu tùy màu sắc. Những bé này có giấy tờ đầy đủ giấy tờ nhập khẩu và các loại giấy tờ như chó Husky trong nước.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Đắt nhất là chó Husky nhập khẩu từ châu Âu (Nga, Ukraina hoặc Serbia) thường có giá khoảng 2200$ – 3000$ khi giao tại Việt Nam. Tất cả các bé Husky&lt;strong&gt;&amp;nbsp;&lt;/strong&gt;nhập khẩu từ châu Âu đều có chất lượng gen rất cao, thuần chủng tinh khiết và có đầy đủ khai sinh và gia phả FCI. Những bé Husky này thường được huấn luyện tham gia Dogshow, hoặc nhân giống tại các trại giống chuyên nghiệp.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;husky-nhap-khau&quot; data-cke-saved-src=&quot;https://i1.wp.com/tintucthucung.com/wp-content/uploads/2019/04/cho-husky-3.jpg?w=1100&amp;amp;ssl=1&quot; src=&quot;https://i1.wp.com/tintucthucung.com/wp-content/uploads/2019/04/cho-husky-3.jpg?w=1100&amp;amp;ssl=1&quot;&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;em&gt;Husky nhập khẩu từ châu Âu – Mỹ có giá rất cao&lt;/em&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Hy vọng với bài viết trên các bạn đã nắm rõ cách phân biệt giống&lt;strong&gt;&lt;a data-cke-saved-href=&quot;https://tintucthucung.com/&quot; href=&quot;https://tintucthucung.com/&quot;&gt;&amp;nbsp;&lt;/a&gt;chó Alaska và Husky&lt;/strong&gt;&amp;nbsp;một cách dễ dàng. Hãy theo dõi Tin tức thú cưng để cập nhật thêm nhiều kiến thức về thế giới thú cưng nhé.&lt;/p&gt;','Cách nhận biết điểm khác biệt giữa chó Alaska và Husky.','','','dog,husky,alaska'),(152,12,2,'Não của chó thay đổi sau 15.000 năm sống chung với người','','&lt;p style=&quot;text-align: center; &quot;&gt;Con người chúng ta thường xuyên tác động lên quá trình tiến hóa của các loài sinh vật khác. Vì thế, chúng ta nên tác động đến chúng một cách có trách nhiệm nhất.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Trong suốt hàng ngàn năm qua loài&amp;nbsp;&lt;a data-cke-saved-href=&quot;https://dogily.vn/cho-canh/&quot; href=&quot;https://dogily.vn/cho-canh/&quot;&gt;chó&lt;/a&gt;&amp;nbsp;đã sinh sống cùng với con người. Trong quá trình sinh sống đó, chúng ta đã thuần hóa và biến những chú chó sói hoang đáng sợ thành lũ cún ngoan ngoãn, dễ dạy bảo.&lt;/p&gt;&lt;p style=&quot;text-align: center; &quot;&gt;&lt;img alt=&quot;Não bộ của loài chó cũng bị thảy đổi do tác động của con người&quot; data-cke-saved-src=&quot;https://dogily.vn/wp-content/uploads/2019/12/N%C3%83O-B%E1%BB%98-LO%C3%80I-CH%C3%93-THAY-%C4%90%E1%BB%94I-SAU-15000-N%C4%82M.jpg&quot; src=&quot;https://dogily.vn/wp-content/uploads/2019/12/N%C3%83O-B%E1%BB%98-LO%C3%80I-CH%C3%93-THAY-%C4%90%E1%BB%94I-SAU-15000-N%C4%82M.jpg&quot; style=&quot;height:453px; width:680px&quot;&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Não bộ của loài chó cũng bị thảy đổi do tác động của con người&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Có thể nói chó là một trong những loài động vật có nhiều biến thể nhất thông qua các hoạt động lai lạo của con người. Một nghiên cứu mới quét não của những chú chó được sinh sống cùng với con người cho thấy não bộ của chúng đã có những thay đổi sâu sắc.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Khi chúng ta biến chúng từ những kẻ săn mồi thành người bạn trung thành, cấu trúc não bộ của chúng đã được thay đổi.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Erin Hecht – Một nhà thần kinh học tại Đại học Harvar đã khám ra khi cô cùng đồng nghiệp tập hợp lại bộ sưu tập ảnh quét não MRI. Bộ sưu tập hình ảnh bao gồm 62 chú chó thuần chủng thuộc 33 giống chó khác nhau.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Phát hiện mới này chưa từng có bất cứ nhà khoa học nào thu thập được dữ liệu như vậy và đi theo hướng nghiên cứu này. Ngay khi đặt các hình ảnh kế bên nhau, Hecht nói rằng “ngay lập tức bạn có thể nhìn thấy kết quả đập vào mắt của mình”. Hơn ba chục giống chó khác nhau nên sẽ có nhiều hình dạng và kích cỡ hộp sọ. Nhưng vẫn không thể giải thích sự khác biệt trong cách bố trí bộ não của chúng.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Nhóm nghiên cứu của Hecht đã xác định được sáu mạng lưới và vùng não có xu hướng khác biệt rõ ràng giữa các loài chó với nhau. Các mạng lưới này liên kết với các chức năng nhất định như vận động hoặc khứu giác.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Ở mỗi giống chó được con người thuần chủng sẽ phục vụ cho các mục đích khác nhau. Vì thế, chúng phát triển theo từng vùng não một cách khác nhau.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Giống như những chú&amp;nbsp;&lt;a data-cke-saved-href=&quot;https://dogily.vn/cho-canh/doberman-pinscher/giong-cho-doberman/&quot; href=&quot;https://dogily.vn/cho-canh/doberman-pinscher/giong-cho-doberman/&quot;&gt;chó Dobermans&lt;/a&gt;&amp;nbsp;và chó võ sĩ sẽ thường được sử dụng phục vụ cho quân đội, cảnh sát. Khứu giác và thị giác của hai chú chó này rất là phát triển. Con chó lai tạo để phục vụ cho việc thi đấu thể thao cho thấy não bộ của chúng chịu sự căng thẳng, sợ hãi và lo lắng. Còn giống&amp;nbsp;&lt;a data-cke-saved-href=&quot;https://dogily.vn/tin-tuc/giong-cho-chan-cuu/&quot; href=&quot;https://dogily.vn/tin-tuc/giong-cho-chan-cuu/&quot;&gt;chó chăn cừu&lt;/a&gt;&amp;nbsp;có được sự nhanh nhẹn và tốc độ chính nhờ vùng não vận động phát triển.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Hecht chia sẻ: “Đặc điểm giải phẫu não giữa các giống chó khác nhau, chắc chắn một trong những lí do đó là do sự tác động của con người trong việc nhân giống. Kể cả việc huấn luyện chúng với những hành động cụ thể như chăn thả, săn bắn và bảo vệ đàn gia súc”.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Hecht cũng lấy một ví dụ điển hình về những chú chó săn được huấn luyện theo hai phong cách khác nhau. Những chú chó này có thể sử dụng khứu giác hoặc thị giác để phát hiện ra con mồi. Nếu phát triển tự nhiên, bạn sẽ nghĩ những con chó săn mồi bằng khứu giác chúng sẽ có vùng não khứu giác phát triển.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Điều đó là không đúng so với kết quả chụp MRI. Kết quả chụp MRI của chúng chỉ cho thấy một mô hình cực kỳ liên quan đến các hoạt động huấn luyện của con người. Vùng não hiểu và truyền đạt thông tin của những chú chó chuyên đi săn bằng mùi hương rất phát triển.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Cô ấy giải thích: “Các huấn luyện viên dạy những chú chó săn mồi bằng mùi bảo rằng bạn không cần phải huấn luyện một con chó ngửi thấy mùi. Thay vào đó, bạn chỉ cần huấn luyện chúng báo cáo về mùi hương đó”. Chứng tỏ chính hoạt động huấn luyện mới làm thay đổi não bộ của những chú chó săn thay vì bản năng săn mồi.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;Não bộ của loài chó săn thay đổi nhờ vào hoạt động huấn luyện của con người, thay vì bản năng săn mồi của chúng&quot; data-cke-saved-src=&quot;https://dogily.vn/wp-content/uploads/2019/12/CH%C3%8DNH-HO%E1%BA%A0T-%C4%90%E1%BB%98NG-HU%E1%BA%A4N-LUY%E1%BB%86N-C%E1%BB%A6A-CON-NG%C6%AF%E1%BB%9CI-L%C3%80M-THAY-%C4%90%E1%BB%94I-B%E1%BB%98-N%C3%83O-CH%C3%93-S%C4%82N-1.jpg&quot; src=&quot;https://dogily.vn/wp-content/uploads/2019/12/CH%C3%8DNH-HO%E1%BA%A0T-%C4%90%E1%BB%98NG-HU%E1%BA%A4N-LUY%E1%BB%86N-C%E1%BB%A6A-CON-NG%C6%AF%E1%BB%9CI-L%C3%80M-THAY-%C4%90%E1%BB%94I-B%E1%BB%98-N%C3%83O-CH%C3%93-S%C4%82N-1.jpg&quot; style=&quot;height:453px; width:680px&quot;&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Não bộ của loài chó săn thay đổi nhờ vào hoạt động huấn luyện của con người, thay vì bản năng săn mồi của chúng&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Nhà tâm lí học Daniel Horschler cho biết: “Đây là một nghiên cứu mới rất thú vị”. Lúc trước, Horschler đã từng nghiên cứu về sự tiến hóa của não chó. Nhà tâm lí học Horschler khẳng định nghiên cứu này là những phát hiện đầu tiên nói đến mối tương quan giữa cấu trúc não và hành vi được định hình bởi con người.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Con ngừơi đã thay đổi các loài động vật xung quanh mình và cả cấu trúc não bộ của chúng. Những thay đổi của chúng là cực kỳ sâu sắc. Vì thế, chúng ta phải có trách nhiệm với chúng khi đã khiến chúng thay đổi đến như vậy.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Riêng Hecht cũng đã nuôi hai chú chó nhỏ giống chó chăn cừu Úc. Cô tâm sự: “Với tôi, những con&amp;nbsp;&lt;a data-cke-saved-href=&quot;https://dogily.vn/cho-canh/&quot; href=&quot;https://dogily.vn/cho-canh/&quot;&gt;chó&lt;/a&gt;&amp;nbsp;ở đây, cũng như tổ tiên của chúng đã chung sống cùng tổ tiên của tôi. Tôi thấy đó là một mối liên hệ vô cùng sâu sắc, kỳ lạ và thật tuyệt vời”.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;Chúng ta nên có trách nhiệm rõ ràng với sự tác động của mình đối với các loài sinh vật&quot; data-cke-saved-src=&quot;https://dogily.vn/wp-content/uploads/2019/12/S%E1%BB%B0-T%C3%81C-%C4%90%E1%BB%98NG-C%E1%BB%A6A-CON-NG%C6%AF%E1%BB%9CI.png&quot; src=&quot;https://dogily.vn/wp-content/uploads/2019/12/S%E1%BB%B0-T%C3%81C-%C4%90%E1%BB%98NG-C%E1%BB%A6A-CON-NG%C6%AF%E1%BB%9CI.png&quot; style=&quot;height:453px; width:680px&quot;&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Chúng ta nên có trách nhiệm rõ ràng với sự tác động của mình đối với các loài sinh vật&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Tại một thời điểm của lịch sử chúng ta cũng chỉ là một sinh vật đơn lẻ. Vì thế, nếu chúng ta tác động lên sự sống và quá trình tiến hóa của các loài sinh vật khác. Hecht nghĩ chúng ta nên làm điều đó dưới một nhận thức có trách nhiệm rõ ràng.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Hecht chia sẻ: “Tôi nghĩ nghiên cứu của mình sẽ trở thành một lời kêu gọi trách nhiệm. Khi chúng ta đối xử với các động vật như chúng ta vẫn đang đối xử”.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Tạp chí Journalof Neuroscience đã công bố nghiên cứu mới này của cô.&lt;/p&gt;','Não của chó thay đổi sau 15.000 năm sống chung với người','','','dog,husky,alaska	'),(155,10,1,'Amazing day','Lorem ipsum dolor sit amet, justo aliquid reformidans ea vel, vim porro dictas et, ut elit partem invidunt vis. Saepe melius complectitur eum ea. Zril delenit vis ut. His suavitate rationibus in, tale discere ceteros eu nec. Vel ut utamur laoreet vituperata, in discere contentiones definitionem ius.','&lt;p style=&quot;text-align: center; &quot;&gt;Lorem ipsum dolor sit amet, justo aliquid reformidans ea vel, vim porro dictas et, ut elit partem invidunt vis. Saepe melius complectitur eum ea. Zril delenit vis ut. His suavitate rationibus in, tale discere ceteros eu nec. Vel ut utamur laoreet vituperata, in discere contentiones definitionem ius.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;','Amazing day','','','vocation,holiday,day off,look'),(153,12,1,'Dogs\' brains change after 15,000 years of living with humans','','&lt;p style=&quot;text-align: center; &quot;&gt;We humans constantly influence the evolution of other living things. Therefore, we should influence them in the most responsible way.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center; &quot;&gt;For thousands of years dogs have lived with humans. In the course of that living, we domesticated and turned the scary wild wolves into docile, docile puppies.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Dogs\' brains are also altered by human action&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;It can be said that dogs are one of the animals with the most variation through the crossbreeding activities of humans. A new study that scans the brains of dogs that live with humans shows profound changes in their brains.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;When we turned them from predators into loyal friends, their brain structure was changed.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Erin Hecht - A neuroscientist at Harvar University discovered when she and her colleague gathered a collection of MRI brain scans. The image collection includes 62 purebred dogs of 33 different dog breeds.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;This new discovery has never been used by any scientist to gather such data and follow this research direction. As soon as the pictures were placed side by side, Hecht said that &quot;you can immediately see the results that catch your eye.&quot; More than thirty different dog breeds will come in many shapes and sizes of skulls. But still cannot explain the difference in the layout of their brains.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Hecht\'s team has identified six networks and brain regions that tend to be distinctly different from dog to dog. These networks are associated with certain functions like motor or olfactory.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;In every dog ​​breed purebred human will serve different purposes. Therefore, they develop in different brain regions.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Like the Dobermans and boxers will often be used for the military and police. The sense of smell and vision of these two dogs is very developed. Dogs bred for sports competition show their brains under stress, fear and anxiety. And the shepherd dog gets its agility and speed through the development of the motor brain.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Hecht said: “The characteristics of brain anatomy between different dog breeds, certainly one of the reasons is due to the human influence in breeding. Including training them with specific actions such as grazing, hunting and protecting the cattle. ”&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Hecht also took a good example of hounds trained in two different styles. These dogs can use their sense of smell or vision to detect prey. If you grow naturally, you will think that olfactory predators will have a developed olfactory brain.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;That is not true of the MRI results. The results of their MRI scan only show an extremely relevant model of human training activities. The brain region understands and communicates the scent of hunting dogs with highly developed scent.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;She explained: “The coaches who teach the dogs of smell by saying that you do not need to train a dog smell. Instead, just train them to report on the scent. ” It is shown that it is the training that changes the hunting dogs\' brains instead of the hunting instincts.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Hounds of the hound change due to human training, instead of their hunting instincts&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&quot;This is an interesting new study,&quot; said psychologist Daniel Horschler. Horschler had previously studied the evolution of the dog brain. Psychchild Horschler claims this research is the first findings of the correlation between brain structure and human-shaped behavior.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Humans have changed the animals around them and their brain structures. Their changes are extremely profound. Therefore, we have to be responsible for them for making them so change.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Hecht himself also raised two small dogs of the Australian shepherd breed. She said: “To me, the dogs here, as well as their ancestors, have lived with my ancestors. I find it a very deep, strange and wonderful connection. ”&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;We should be clearly accountable for our impact on the creatures&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;At one point in history we were also a single creature. Therefore, if we affect the life and evolution of other species. Hecht thinks we should do it under a clear sense of responsibility.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Hecht said: “I think my research will become a call for responsibility. When we treat animals like we are still treating them. ”&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;Journalof Neuroscience published her new research.&lt;/p&gt;','Dogs\' brains change after 15,000 years of living with humans','','','');
/*!40000 ALTER TABLE `oc_bm_post_description` ENABLE KEYS */;
UNLOCK TABLES;

