INSERT INTO `oc_product_description` VALUES (50,2,' Cắt tỉa và tạo kiểu lông cho chó mèo','&lt;p&gt;Trimming and styling dogs and cats&lt;br&gt;&lt;/p&gt;','',' Cắt tỉa và tạo kiểu lông cho chó mèo',' Cắt tỉa và tạo kiểu lông cho chó mèo',' Cắt tỉa và tạo kiểu lông cho chó mèo'),(50,1,'Trimming and styling dogs and cats','','','Trimming and styling dogs and cats','',''),(51,1,'Persian fur is white','','','SA','',''),(51,2,'Mèo Ba Tư lông trắng','','','SA','',''),(52,2,'Bát ăn tự động chó mèo','','Bát ăn tự động chó mèo','Bát ăn tự động chó mèo','Bát ăn tự động chó mèo','Bát ăn tự động chó mèo'),(52,1,'Automatic feeding bowl for cats and dogs','','Automatic feeding bowl for cats and dogs','Automatic feeding bowl for cats and dogs','Automatic feeding bowl for cats and dogs','Automatic feeding bowl for cats and dogs'),(53,2,'Mèo Bengal','','','Mèo Bengal','',''),(53,1,'Bengal cat','','','Bengal cat','',''),(54,2,'Dây chuyền mạ vàng cho chó','','','Dây chuyền mạ vàng cho chó','',''),(54,1,'Gold-plated necklaces for dogs','','','Gold-plated necklaces for dogs','',''),(55,2,'Mèo Scottish Straight','','','Mèo Scottish Straight','',''),(55,1,'Scottish Straight Cat','','','Scottish Straight Cat','',''),(56,2,'Mèo Munchkin bicolor','','','Mèo Munchkin bicolor','',''),(56,1,'Munchkin Bicolor Cat','','','Munchkin Bcolor Cat','',''),(57,2,'Mèo Anh lông ngắn','','','Mèo Anh lông ngắn','',''),(57,1,'British Shorthair','','','British Shorthair','',''),(58,2,'Gối cho mèo','','','Gối cho mèo','',''),(58,1,'Pillows for cats','','','Pillows for cats','',''),(59,2,'Chó Alaska','','','Chó Alaska','',''),(59,1,'Alaska Dog','','','Alaska Dog','',''),(60,2,'Chó Corgi','','','Chó Corgi','',''),(60,1,'Corgi Dog','','','Corgi Dog','',''),(61,2,'Chó Golden','','','Chó Golden','',''),(61,1,'Golden Dog','','','Golden Dog','',''),(62,2,'Cắt và chăm sóc móng cho chó mèo','','','Cắt và chăm sóc móng cho chó mèo','',''),(62,1,'Cut and care for dogs and cats','','','Cut and care for dogs and cats','',''),(63,2,'Chó Husky','','','Chó Husky','',''),(63,1,'Husky Dog','','','Husky Dog','',''),(64,2,'Chó Poodle ','','','Chó Poodle ','',''),(64,1,'Poodle  Dog','','','Poodle  Dog','',''),(65,2,'Tắm và chăm sóc lông cho chó mèo','&lt;p&gt;Bước 1: Da và lông của cún sẽ được kiểm tra kĩ càng nhằm xác định loại dầu tắm thích hợp. &amp;nbsp;&lt;/p&gt;&lt;p&gt;Bước 2: Các chuyên viên sẽ bóp dịch hậu môn một cách cẩn thận và chuyên nghiệp nhằm khử hoàn toàn mùi hôi trên thân thể các em. &amp;nbsp;&lt;/p&gt;&lt;p&gt;Bước 3: Cún sẽ được xả nước sạch rồi thoa dầu tắm, đồng thời thời nhẹ nhàng massage để thư giãn và loại bỏ chất bẩn trên lông với sự hỗ trợ của các dụng cụ chuyên nghiệp. &amp;nbsp;&lt;/p&gt;&lt;p&gt;Bước 4: Xả sạch sữa tắm và sử dụng dầu xả để tạo độ mềm mượt, đồng thời dưỡng ẩm cho da và lông chó. &amp;nbsp;&lt;/p&gt;&lt;p&gt;Bước 5: Xả lại bằng nước sạch cho đến khi sạch dầu xả, rồi sấy khô và chải lông nhằm loại bỏ lông chết còn sót lại. &amp;nbsp;&lt;/p&gt;&lt;p&gt;Bước 6: Lông cún sẽ được thoa một lớp lotion nhằm tạo độ bóng mượt tự nhiên, sạch sẽ. &amp;nbsp;&lt;/p&gt;&lt;p&gt;Bước 7: Xịt nước hoa, tạo hương thơm lưu giữ lâu dài trên cơ thể chó cưng.&lt;/p&gt;','','Tắm và chăm sóc lông cho chó mèo','',''),(65,1,'Bathe and groom cats and dogs','&lt;p&gt;Step 1: The dog\'s skin and fur will be carefully examined to determine the appropriate type of bath oil.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Step 2: The therapist will squeeze the anal fluid carefully and professionally to completely eliminate the odor from your body.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Step 3: The dog will be rinsed with clean water and then applied the bath oil, while gently massaging to relax and remove the dirt on the fur with the help of professional tools.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Step 4: Rinse the shower gel and use conditioner to make it soft and moisturize the skin and fur of dogs.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Step 5: Rinse with clean water until the conditioner is clean, then dry and brush to remove remaining hair.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Step 6: The dog\'s coat will be applied with a layer of lotion to create a natural, clean luster.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Step 7: Spray perfume, create a scent, lasting retention on the pet dog.&lt;/p&gt;','','Bathe and groom cats and dogs','','');
/*!40000 ALTER TABLE `oc_product_description` ENABLE KEYS */;
UNLOCK TABLES;

